import React, { useState } from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";

import logo from "./logo.svg";

import "./App.css";

function Head(props) {
  var [navBar, setPos] = useState(false);

  function menuNavBar() {
    var setValue = 1;

    if (navBar === false) {
      document.getElementById("menu").style.display = "initial";

      setPos(true);
    } else {
      document.getElementById("menu").style.display = "none";

      // document.getElementById("menu").style.height = "2";
      setPos(false);
    }
  }


  return (
    <div>
      <div className="header-bar">
        <header>
          <div className="logo"><span className="logo1"><i className="fa copyRight"></i></span><span className="logo2">SKILLS</span></div>{" "}

          <div className="hd-col">
          <Link to="/" className="hd">
              HOME
            </Link>
            <Link to="/aboutus/" className="hd">
              ABOUT US
            </Link>
            <Link to="/blog/" className="hd">
              BLOG
            </Link>
            <Link to="/developer/" className="hd">
              DEVELOPER
            </Link>

          </div>
          <div className="hamburg" onClick={menuNavBar}>
            <i className="fa fa-bars" style={{ fontSize: "2em" }}>
              {" "}
            </i>
          </div>
        </header>
        <div className="menu" id="menu">
          <div className="navbar" id="navbar">
            {/* <hr style={{marginTop:"-0.2em"}}/> */}
            <div
              className="hdm home"

            >
              HOME
            </div>
            {/* <hr /> */}
            <div
              className="hdm"
              onClick={() => window.scrollTo({ top: 500, behavior: "smooth" })}
            >
              ABOUT US
            </div>
            {/* <hr /> */}
            <div
              className="hdm"
              onClick={() => window.scrollTo({ top: 1750, behavior: "smooth" })}
            >
              BLOG
            </div>
            {/* <hr /> */}
            <div to="/applications/" className="hdm">
              DEVELOPER
            </div>
            <hr />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Head;
